webpackJsonp([0x8eaedc3bed1a],{2259:function(e,a){e.exports={pathContext:{docHtml:'<h1>duplexer</h1>\n<p><a href="https://travis-ci.org/Raynos/duplexer"><img src="https://secure.travis-ci.org/Raynos/duplexer.png" alt="build status"></a> <a href="https://david-dm.org/Raynos/duplexer"><img src="https://david-dm.org/Raynos/duplexer.png" alt="dependency status"></a></p>\n<p><a href="https://ci.testling.com/Raynos/duplexer"><img src="https://ci.testling.com/Raynos/duplexer.png" alt="browser support"></a></p>\n<p>Creates a duplex stream</p>\n<p>Taken from <a href="https://github.com/dominictarr/event-stream#duplex-writestream-readstream">event-stream</a></p>\n<h2>duplex (writeStream, readStream)</h2>\n<p>Takes a writable stream and a readable stream and makes them appear as a readable writable stream.</p>\n<p>It is assumed that the two streams are connected to each other in some way.</p>\n<h2>Example</h2>\n<pre><code class="language-js">var grep = cp.exec(\'grep Stream\')\n\nduplex(grep.stdin, grep.stdout)\n</code></pre>\n<h2>Installation</h2>\n<p><code>npm install duplexer</code></p>\n<h2>Tests</h2>\n<p><code>npm test</code></p>\n<h2>Contributors</h2>\n<ul>\n<li>Dominictarr</li>\n<li>Raynos</li>\n<li>samccone</li>\n</ul>\n<h2>MIT Licenced</h2>',docPath:"argo-ci/node_modules/duplexer/readme",proj:"argo-ci"}}}});
